import React from 'react';

interface VideoCardProps {
    song: {
        id: string;
        title: string;
        thumbnailUrl: string; // 썸네일 URL 추가
        description: string;
    };
}

const VideoCard: React.FC<VideoCardProps> = ({ song }) => {
    return (
        <div className="video-card">
            <img
                src={song.thumbnailUrl} // 썸네일 이미지 URL 적용
                alt={song.title}
                className="video-thumbnail"
                onError={(e: any) => { e.target.src = "/images/default_thumbnail.png"; }} // 이미지 로딩 실패 시 기본 이미지 사용
            />
            <h3>{song.title}</h3>
            <p>{song.description}</p>
        </div>
    );
};

export default VideoCard;
